import { Button, Container,Row,Col}from 'react-bootstrap';
export default class UseBootstrap extends Component {
    render() {
        return (
            <div>
                <Button onClick={()=>alert('item Clicked')}>Click me</Button>

                <Container>
  <Row>
    <Col>1 of 2</Col>
    <Col>2 of 2</Col>
  </Row>
  <Row>
    <Col>1 of 3</Col>
    <Col>2 of 3</Col>
    <Col>3 of 3</Col>
  </Row>
</Container>
            </div>
        )
    }
}
